sys_variable_value.value:
(function execute(inputs, outputs) {

    const api = new x_neyu_modtrak.ModTrakAPI();

    const response = api.close(
        inputs.number,
        inputs.modtrak,
        inputs.status,
        inputs.comments
    );

    outputs.error1 = response.error;
    outputs.errormessage = response.errorMessage;
    if (response.status) {
        outputs.status = response.status;
    } else {
        outputs.status = 500;
    }

})(inputs, outputs);

